                        // placeholder={FormattedJSONConsoles.find(item => item === plataformSelected) ? plataformSelected : 'Plataforma'}
                        options={FormattedJSONConsoles}
                        classNames={'select-class'}
                        name="platform"
                    />
                </div>
            </div>
        </div>
    )
}

export default FilterHistoric;
